import styled from "styled-components";
import diceImageone from "../src/images/image1.png"; // Assuming this is the correct relative path
const RollDice = () => {
  return (
    <DiceContainer>
      <div>
        <img src={diceImageone} alt="dice image1" />
        <p>Click on Dice to roll</p>
        <button>Reset Score</button>
        <button>Show Rules</button>
      </div>
    </DiceContainer>
  );
};
export default RollDice;

const DiceContainer = styled.div`
display:flex;
margin-top:48px;
justify-content:center;
.p{
    justify-content:center;
}
`;
